import React from 'react';
import styles from './styles.module.css';

const Header = () => {
  return (
    <div className='bg-gray-200 p-4 test'>
      <div className='container mx-auto'>
        PalpiteBox
      </div>
      <div className={'p-4 ' + styles.test}>
        randel
      </div>
    </div>
  )
}

export default Header;
